      list: []
    };
  }

  render() {
    return (
      <Fragment>
        <div>
          <input /> <button> 提交 </button>
        </div>
        <ul>
          <li>xueyingyu</li>
          <li>buxue</li>
        </ul>
      </Fragment>
    );
  }
}

export default TodoList;
